import React from 'react';
import logo from './logo.svg';
import PlotRoute from './components/PlotRoute.js';
import { VictoryChart, VictoryVoronoiContainer, VictoryGroup, VictoryTooltip, VictoryLine, VictoryScatter, VictoryAxis, VictoryTheme } from 'victory';
import './App.css';

const data = [
  { x: 0, y: 0 },
  { x: 1, y: 0 }
];

const strokeDasharray = "10, 5";

class App extends React.Component {

  render() {
    return (
      <VictoryChart height={300} width={300} containerComponent={<VictoryVoronoiContainer/>}>
        <VictoryAxis crossAxis
          width={300}
          height={300}
          domain={[-10, 10]}
          theme={VictoryTheme.material}
          offsetY={150}
          standalone={false}
          style={{
            grid: {stroke: "#ECEFF1", strokeDasharray},
            ticks: {stroke: "grey", size: 5},
            tickLabels: {fontSize: 5, padding: 2}
          }}
        />
        <VictoryAxis dependentAxis crossAxis
          width={300}
          height={300}
          domain={[-10, 10]}
          theme={VictoryTheme.material}
          offsetX={150}
          standalone={false}
          style={{
            grid: {stroke: "#ECEFF1", strokeDasharray},
            ticks: {stroke: "grey", size: 5},
            tickLabels: {fontSize: 5, padding: 2}
          }}
        />
        {() => {
          let lines = [];
          for (let i = 1; i < 2; i++) {
            lines.push(        
              <VictoryGroup
                color="#c43a31"
                labels={({ datum }) => `x: ${datum.x} y: ${datum.y}`}
                labelComponent={
                <VictoryTooltip style={{ fontSize: 5 }}/>
                }
                data={data}
              >
                <VictoryLine animate={{ duration: 1000, onLoad: { duration: 1000 } }}/>
                <VictoryScatter size={({ active }) => active ? 4 : 2}/>
              </VictoryGroup>
            );
          }
          {console.log(lines)}
          return lines;
        }}
      </VictoryChart>
    );
  }
}

export default App;


